import '../styles/CategoryPage.css'; // Import the CSS file

// Import category images
import AdventureImg from '../assets/Bike categories/Adventure.png';
import CruiserImg from '../assets/Bike categories/Cruiser.png';
import DirtImg from '../assets/Bike categories/Dirt.png';
import RetroImg from '../assets/Bike categories/Retro.png';
import SportImg from '../assets/Bike categories/sports.png'; // Note: filename is 'sports.png'
import StreetImg from '../assets/Bike categories/street.png'; // Note: filename is 'street.png'
import SuperSportImg from '../assets/Bike categories/super.png'; // Assuming 'super.png' is for SuperSport
import TourerImg from '../assets/Bike categories/Tourer.png';

// Define the categories with imported images
const categories = [
    { name: 'Street', image: StreetImg },
    { name: 'Sport', image: SportImg },
    { name: 'Adventure', image: AdventureImg },
    { name: 'Cruiser', image: CruiserImg },
    { name: 'SuperSport', image: SuperSportImg },
    { name: 'Retro', image: RetroImg },
    { name: 'Tourer', image: TourerImg },
    { name: 'Dirt', image: DirtImg },
];

function CategoryPage() { // Renaming to CategoryPage as requested, though used as a section
    return (
        <section className="category-section-homepage"> {/* Use a specific class for this section */}
            <h2>Browse by Category</h2>
            <div className="categories-grid-homepage"> {/* Use a specific class for the grid */}
                {categories.map((category, index) => (
                    <div key={index} className="category-item-homepage"> {/* Use a specific class for items */}
                        <img
                            src={category.image}
                            alt={category.name}
                            className="category-image-homepage" // Use a specific class for images
                        />
                        {/* <p>{category.name}</p> */}
                    </div>
                ))}
            </div>
        </section>
    );
}

export default CategoryPage; // Exporting as CategoryPage
